@mixin font-size($size: $rem-baseline, $line: $size * 1.6) {
	font-size: $size + px;
	font-size: ($size / $rem-baseline) + rem;
	line-height: ($line) + px;
	line-height: ($line / $rem-baseline) + rem;
}

